export interface RenderOption {
    /**
     * 格式方案ID
     */
    schemaId?: any;
    /**
     * 格式方案对象
     */
    schemaValue?: any;
    /**
     * 查询ID
     */
    queryId?: any;
    /**
     * spread控件对象实例
     */
    spread?: any;
    /**
     * 结果页组件实例
     */
    qdpView?: any;
    /**
     * 查询类型: list  treelist  crosstab
     */
    controlType?: any;
    /**
     * QO编号
     */
    qoManagerCode?: any;
    /**
     * 页索引
     */
    pageIndex?: any;
    /**
     * eapi请求uri
     */
    queryRelativeUrl?: any;
    /**
     * 过滤条件表达式
     */
    filterCondition?: any;
    /**
     * 表单数据
     */
    formData?: any;
    /**
     * 格式方案分组类型
     */
    groupType?: any;
    /**
     * 参数vo主键
     */
    voId?: any;
    /**
     * 缓存开关：用于格式方案管理
     * true: 在客户端缓存中获取格式方案
     * false: 发送服务器端请求，获取格式方案列表，更行客户端缓存，最后在刷新后的缓存中获取格式方案信息
     */
    fromCache?: any;
    /**
     * 总记录数
     */
    totalCount?: any;
    /**
     * 打印设置
     */
    printIntegration?: any;
    /**
     * 查询数据
     */
    data?: any;
    /**
     * spread模板
     */
    template?: any;
    /**
     * 进度条控件实例
     */
    loading?: any;
    /**
     * 固定列
     */
    frozenCols?: any;
    /**
     * 自定格式方案
     */
    customFormatScheme?: any;
    /**
     * 联查信息列表
     */
    jointsearchInfoList?: any;
    /**
     * 导出类型：按文本或者值导出
     */
    exportType?: any;
    /**
     * 是否切换格式方案
     */
    isSchemaSelectChanged?: any;
    /**
     * 支持多sheet页
     */
    multiSheets?: any;
    /**
     * 当前sheet
     */
    curSheet?: any;
    multiSheetsSchemaIds?: any;
    excelExportName?: any;
}
